'''Dagannoth spawn''' are baby [[dagannoth]] hatched from eggs found near the walls or water of [[Waterbirth Dungeon]]. The eggs will hatch as players walk near. The eggs respawn after 5 minutes.

Despite their low [[combat level]], they are hostile to players of all levels.

==Habitat==
*[[Waterbirth Island Dungeon]]

